#[allow(dead_code)]
mod list_node;
use list_node::*;

struct Solution;

type Node = Option<Box<ListNode>>;
impl Solution {
    pub fn reorder_list(head: &mut Node) {
        if head.is_none() || head.as_ref().unwrap().next.is_none() {
            return;
        }
        let mut head1 = head;
        let middle = Self::split_middle(&mut head1);
        println!("{:?}", middle.as_ref().unwrap().val);
        let mut head2 = &mut Self::reverse(middle);
        Self::merge(&mut head1, &mut head2);
    }

    fn split_middle(head: &mut Node) -> Node {
        let mut fast = head.clone();
        let mut slow = head;
        while fast.is_some() && fast.as_ref().unwrap().next.is_some() {
            slow = &mut slow.as_mut().unwrap().next;
            fast = fast.as_ref().unwrap().next.as_ref().unwrap().next.clone();
        }
        slow.take()
    }

    fn reverse(head: Node) -> Node {
        let mut prev: Node = None;
        let mut curr: Node = head;
        while let Some(mut node) = curr {
            let mut next = node.next.take();
            node.next = prev.take();
            prev = Some(node);
            curr = next.take();
        }
        prev
    }

    fn merge(odd: &mut Node, even: &mut Node) {
        let mut dummy_head = Box::new(ListNode::new(-1));
        let mut iter = &mut dummy_head;
        let (mut p, mut q) = (odd.as_ref(), even.as_ref());
        while let (Some(a), Some(b)) = (p, q) {
            p = a.next.as_ref();
            iter.next = Some(a.clone());
            iter = iter.next.as_mut().unwrap();
            q = b.next.as_ref();
            iter.next = Some(b.clone());
            iter = iter.next.as_mut().unwrap();
        }
        *odd = dummy_head.next;
    }
}

